import { SET_USER_NAME, SET_TOKEN} from "./actionTypes";

export const set_Username = (user_name) => {
  return { type: SET_USER_NAME, payload: user_name };
};

export const setToken = (token) => {
  return { type: SET_TOKEN, payload: token };
};
